import axios from 'axios';
import React, { Component } from 'react'

export class Stations extends Component {
    constructor() {
        super();
        this.state = {
            Stations: []
        }
    }

    componentDidMount(){
        axios.get(`http://localhost:8080/admin/station/get`)
    }



    render() {
        return (
            <div>
                <table>
                    <thead>
                        <tr>
                            <th>S.No</th>
                            <th>Station Id</th>
                            <th>Station Name</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            this.state.Stations.map((station, index) =>
                                <tr key={station.id}>
                                    <td>{index + 1}</td>
                                    <td>{station.id}</td>
                                    <td>{station.stationName}</td>
                                </tr>

                            )
                        }
                    </tbody>
                </table>
            </div>
        )
    }
}

export default Stations
